import React, { useEffect } from "react";
import { useParams } from "react-router";

function Post() {
  let { postSlug } = useParams();

  useEffect(() => {
    // Fetch post using the postSlug
  }, [postSlug]);

  return (
    <div className="leftcolumn">
      <div className="card">
    <div class="blog-text">
      <h1 className="blog-title">My First Semester at Waterloo CS</h1>
      <h6 className="mb-5">The post slug is, {postSlug}</h6>
      <p>
        Overall an incredibly humbling and eye-opening term. I feel that I learned the most in Algebra,
        followed by CS135 and Calc. I really enjoyed my time at Waterloo with all of my friends (new and old), and have made
        countless memories over the course of 4 months. Every Friday we would have movie night, although I don't pulling
        all-nighters like we did :/. There were times when the courses became really challenging for me
      </p>
    </div>
  </div>
  <div className="card">
  <div class="blog-text">
    <h1 className="blog-title">Mission Cambodia: One Week Volunteering</h1>
    <h6 className="mb-5">The post slug is, {MissionCambodiaOneWeekVolunteering}</h6>
    <p>
      Overall an incredibly humbling and eye-opening term. I feel that I learned the most in Algebra,
      followed by CS135 and Calc. I really enjoyed my time at Waterloo with all of my friends (new and old), and have made
      countless memories over the course of 4 months. Every Friday we would have movie night, although I don't pulling
      all-nighters like we did :/. There were times when the courses became really challenging for me
    </p>
  </div>
</div></div>
  );
}

export default Post;
